function Square () {
  return (
    <button className="Square"></button>
  )
}

export default function Board() {
  return ( 
  <>
    <div className="board-row">
      <Square>1</Square>
      <Square>2</Square>
      <Square>3</Square>
    </div>
    <div className="board-row">
      <Square>4</Square>
      <Square>5</Square>
      <Square>6</Square>
    </div>
    <div className="board-row">
      <Square>7</Square>
      <Square>8</Square>
      <Square>9</Square>
    </div>
  </>
  )
}
